import React from 'react';
import logo from './images/logo.svg';
import {About, Portfolio, Contact} from './components';
import './App.css';

function App() {
  return (
    <div>
      <header className="header">
        <div className="logo">
          <img src={logo}  alt="logo" />
        </div>
      </header>
      <About/>
      <Portfolio/>
      <Contact/>
    </div>
  );
}

export default App;
